<item>
<title>2007-09-03 11:34:56</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsFailedStat/show&amp;time=2007-09-03+11%3A34%3A56</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsFailedStat&amp;amp;v=9e4" class="">/Ambs&amp;nbsp;Cards&amp;nbsp;Manual&amp;nbsp;/&amp;nbsp;Cards&amp;nbsp;Failed&amp;nbsp;Stat&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsFailedStat&amp;amp;time=2007-09-03+11%3A34%3A56">2007-09-03 11:34:56&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsFailedStat&amp;amp;time=2007-09-07+12%3A39%3A51">2007-09-07 12:39:51&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Форма статистики по&amp;nbsp;ошибкам авторизации карт позволяет пользователю просмотреть все&amp;nbsp;неудачные попытки звонков с&amp;nbsp;помощью карт за&amp;nbsp;любой период времени.&lt;br />
Внешний вид&amp;nbsp;формы представлен на&amp;nbsp;следующем рисунке:&lt;br />
&lt;img src="http://78.46.73.113/wiki/files/prim31.png" alt=" (4&amp;nbsp;Кб)" title=" (4&amp;nbsp;Кб)" width='516' height='209' />  &lt;br />
Описание полей формы:&lt;br />
||**Поле**|**Назначение**||&lt;br />
||----||&lt;br />
||**Time period**|
Период времени, за&amp;nbsp;который будут показаны ошибки авторизации карт.
Может принимать следующие значения:
**Today** – сегодня;
**Yesterday** – вчера;
**3 days** – три&amp;nbsp;дня;
**7 days** – семь дней, не&amp;nbsp;включая текущий день;
**Month** – текущий месяц;
**Last month** – предыдущий месяц;
**Period** – период, заданный вручную полями From-To. 
Значение по&amp;nbsp;умолчанию – Today.
||&lt;br />
||**Select time from**|
Период времени в&amp;nbsp;часах, за&amp;nbsp;котрый будут показаны ошибки авторизации карт.
||&lt;br />
||**Time difference (hours)**|
Сдвиг часового пояса в&amp;nbsp;часах. Используется для&amp;nbsp;сдвига ошибок авторизации карт при&amp;nbsp;сверке с&amp;nbsp;партнерами.
Значение по&amp;nbsp;умолчанию: 0 часов.
||&lt;br />
Данные по&amp;nbsp;попыткам позвонить с&amp;nbsp;неправильной авторизацией карт, после нажатия на&amp;nbsp;кнопку «Find», будут показаны в&amp;nbsp;следующем виде:&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">&lt;img src="http://78.46.73.113/wiki/files/uncon.jpg" alt=" (22&amp;nbsp;Кб)" title=" (22&amp;nbsp;Кб)" width='339' height='258' />&lt;/div>&lt;/div>
</description>
</item>
